description:
Liz McAdams is haunted by the memories of a tornado that killed her mother and destroyed her home 25 years ago.

Now a professional storm tracker, she and her family are in danger once again as another devastating twister rapidly gains momentum. Caught in the path of destruction, Liz and her estranged husband Matt struggle to save those they love...
